import React, {memo} from 'react';
import styled from 'styled-components';
import dataset from '../dataset';

const HeaderContainer = styled.div`
    margin-top: 40px;

    background-color: #f605;
    width:100%;
    padding:0 100px;
    height:80px;

    .logoImg {
      width:80px;
      height:auto;
    }
`;

const Header = memo(() => {
  return (
    <HeaderContainer>
      <div>
        <img className='logoImg' alt='logoImg' src='img/logo.png'/>
      </div>
    </HeaderContainer>
  );
});

export default Header;
